import { api } from "../services.js";
export default {
  name: "Produto",
  props: ["id"],
  data: function data() {
    return {
      produto: null
    };
  },
  methods: {
    getProduto: function getProduto() {
      var _this = this;

      api.get("/produto/".concat(this.id)).then(function (response) {
        _this.produto = response.data;
      });
    }
  },
  created: function created() {
    this.getProduto();
  }
};
